INSERT INTO `problems` VALUES (1,'(Q28, S6) Find the number of people in each zip code that are unable to access healthcare because the doctor is too far away or the services are unavailable.','SELECT A.totalNumPeopleWhoAreFarOrUnavailable, response_description ZIP from (SELECT S6 as encoded_Zip, count(S6) as totalNumPeopleWhoAreFarOrUnavailable from chad_encoded_data where Q28 in (SELECT response_encoded_value from data_dictionary, response_description where question_label = \'Q28\' AND ref_response_description = response_description_pk AND response_choice like \'%F%\' OR response_choice like \'%G%\') GROUP BY S6) A, data_dictionary B, response_description C where C.response_description_pk = B.ref_response_description AND A.encoded_Zip = B.response_encoded_value AND B.question_label = \'S6\' order by A.totalNumPeopleWhoAreFarOrUnavailable;'),(2,'find the percentage of people who have less than a high school education and are making 100,000 or more a year (where the percentage is based on all respondents).','select A.CNT/B.TOTAL from (select count(*) CNT from chad_encoded_data where Q46 = (select response_encoded_value from data_dictionary, response_description where question_label = \'Q46\' AND ref_response_description = response_description_pk AND response_description = \'Less than high school\') AND Q47 in ( select response_encoded_value from data_dictionary, response_description where question_label = \'Q47\' AND ref_response_description = response_description_pk AND response_description in (\'$100,000-$124,999\', \'$125,000-$149,999\', \'$150,000-$199,999\', \'$200,000 or more\') ) ) A, (select count(*) TOTAL from chad_encoded_data) B;'),(3,'(Q28,S6) Find the number of people in each zip code that can’t always access their healthcare service by responding “too expensive” and “lack of transportation”.',NULL),(4,'what is the percentage of people who choose less than 3 of the scale 1 to 5 ',NULL),(5,'(Q8, Q16, Q46) Find the percentage of responses where people rated the availability of obtaining Healthy food (4 or 5) as well as Opportunities for physical activity to be 4 or 5 and have an education level of Four-year college or university degree or higher.',NULL),(6,'Find the percentage of people who have a Postgraduate or professional degree, make less than $25,000 a year, and are Employed full-time..',NULL);
